INSERT INTO `mylog` VALUES ('2015-11-05 09:11:25','start'),('2015-11-05 09:11:25','INSERT INTO sqms_question (id, sqms_language_id, sqms_state_id, question, author, version, id_external, sqms_question_id_predecessor, sqms_question_id_successor, sqms_question_type_id, sqms_topic_id) VALUES (0,1,1,\'<p>Welche der folgenden Aussagen bezüglich eines Wörterbuch-Angriffs auf Passwort-Hashes sind korrekt?</p>\',\'rkuhlig\',3,\'\',148,0,1,11)'),('2015-11-05 09:11:25','SELECT id FROM sqms_question WHERE sqms_question_id_predecessor =148 AND version =3'),('2015-11-05 09:11:25','UPDATE sqms_question SET sqms_question_id_successor =152 WHERE id =148 AND version =2'),('2015-11-05 09:11:26','SELECT sqms_users_login, sqms_question_id FROM sqms_question_reviewer WHERE sqms_question_id = 148'),('2015-11-05 09:11:26','INSERT INTO sqms_question_reviewer VALUES(\'mnasari\',152)'),('2015-11-05 09:11:26','SELECT id, answer, correct, sqms_question_id FROM sqms_answer WHERE sqms_question_id = 148'),('2015-11-05 09:11:26','INSERT INTO sqms_answer VALUES(0,\'<p>Wörterbuch-Angriffe werden erleichtert, wenn der \"Verteidiger\" vor der Anwendung der Hash-Funktion eine zufällige Zeichenfolge (Salt) hinzufügt.</p>\',0,152)'),('2015-11-05 09:11:26','INSERT INTO sqms_answer VALUES(0,\'<p>Bei einem Wörterbuch-Angriff spielt die Sprache des Benutzers, dessen Passwort man herausfinden möchte, eine wichtige Rolle.</p>\',1,152)'),('2015-11-05 09:11:26','INSERT INTO sqms_answer VALUES(0,\'<p>Der Wörterbuch-Angriff ist eine Methode der Kryptographie, ein bekanntes Passwort mit Hilfe eines Wörterbuchs auf seine Sicherheit hin zu überprüfen.</p>\',0,152)'),('2015-11-05 09:11:26','ende');
